                    <button style={{ ...actionBtnStyle('#DC2626'), marginBottom: '0' }}>
                        <Phone size={16} color="#fff" fill="#fff" />
                        Call Emergency ({EMERGENCY_NUMBER})
                    </button>
                </a>
            </div>
        </div>
    );
}

